    num *= 1000; // Convert to milliseconds

    return new Promise((resolve) => {
      setTimeout(() => {
        console.log('done');
        resolve('result'); // Replace 'result' with the actual result you want to pass
      }, num);
    });
  }

  async function doAsyncTask() {
    try {
      const x = await wait(2);
      console.log(x);
    } catch (error) {
      console.error(error);
    }
  }

  doAsyncTask();



  return (
    <div>
